import React from 'react';
import { colors } from '../styles/col';

export default function PsychologyDashboard({ metrics, userMood }) {
    const {
        engagement,
        curiosity,
        frustration,
        interactionCount,
        sessionDuration,
        nextRewardIn
    } = metrics;

    const formatTime = (seconds) => {
        const mins = Math.floor(seconds / 60);
        const secs = seconds % 60;
        return `${mins}m ${secs}s`;
    };

    return (
        <div style={styles.container}>
            <h3 style={styles.title}>üìä √âtat Psychologique de la Conversation</h3>

            <div style={styles.metricsGrid}>
                <div style={styles.metricCard}>
                    <div style={styles.metricHeader}>
                        <span style={styles.metricIcon}>üéØ</span>
                        <span style={styles.metricLabel}>Engagement</span>
                    </div>
                    <div style={styles.progressBar}>
                        <div
                            style={{
                                ...styles.progressFill,
                                width: `${engagement * 100}%`,
                                backgroundColor: engagement > 0.7 ? colors.secondary[500] :
                                    engagement > 0.4 ? colors.accent[500] : colors.primary[500]
                            }}
                        />
                    </div>
                    <span style={styles.metricValue}>{Math.round(engagement * 100)}%</span>
                </div>

                <div style={styles.metricCard}>
                    <div style={styles.metricHeader}>
                        <span style={styles.metricIcon}>üí≠</span>
                        <span style={styles.metricLabel}>Curiosit√©</span>
                    </div>
                    <div style={styles.progressBar}>
                        <div
                            style={{
                                ...styles.progressFill,
                                width: `${curiosity * 100}%`,
                                backgroundColor: colors.secondary[500]
                            }}
                        />
                    </div>
                    <span style={styles.metricValue}>{Math.round(curiosity * 100)}%</span>
                </div>

                <div style={styles.metricCard}>
                    <div style={styles.metricHeader}>
                        <span style={styles.metricIcon}>‚ö°</span>
                        <span style={styles.metricLabel}>Frustration</span>
                    </div>
                    <div style={styles.progressBar}>
                        <div
                            style={{
                                ...styles.progressFill,
                                width: `${frustration * 100}%`,
                                backgroundColor: frustration > 0.6 ? '#FF5252' : colors.accent[500]
                            }}
                        />
                    </div>
                    <span style={styles.metricValue}>{Math.round(frustration * 100)}%</span>
                </div>
            </div>

            <div style={styles.statsGrid}>
                <div style={styles.statItem}>
                    <div style={styles.statIcon}>üí¨</div>
                    <div>
                        <div style={styles.statValue}>{interactionCount}</div>
                        <div style={styles.statLabel}>Messages</div>
                    </div>
                </div>

                <div style={styles.statItem}>
                    <div style={styles.statIcon}>‚è±Ô∏è</div>
                    <div>
                        <div style={styles.statValue}>{formatTime(sessionDuration)}</div>
                        <div style={styles.statLabel}>Dur√©e</div>
                    </div>
                </div>

                <div style={styles.statItem}>
                    <div style={styles.statIcon}>üéÅ</div>
                    <div>
                        <div style={styles.statValue}>{nextRewardIn}</div>
                        <div style={styles.statLabel}>Prochaine r√©v√©lation</div>
                    </div>
                </div>
            </div>

            <div style={styles.insights}>
                <h4 style={styles.insightsTitle}>üí° Insights Psychologiques</h4>
                <ul style={styles.insightsList}>
                    <li>R√©compenses variables pour maintenir l'engagement</li>
                    <li>√âquilibre entre confusion et clart√©</li>
                    <li>Effet Barnum : personnalisation des r√©ponses</li>
                    <li>Anthropomorphisme pour cr√©er un lien √©motionnel</li>
                </ul>
            </div>
        </div>
    );
}

const styles = {
    container: {
        backgroundColor: 'white',
        borderRadius: '20px',
        padding: '25px',
        boxShadow: '0 8px 25px rgba(0, 0, 0, 0.08)',
        marginBottom: '25px',
    },
    title: {
        color: colors.neutral[800],
        marginBottom: '25px',
        fontSize: '18px',
        fontWeight: '600',
        textAlign: 'center',
    },
    metricsGrid: {
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: '20px',
        marginBottom: '25px',
    },
    metricCard: {
        backgroundColor: colors.neutral[50],
        borderRadius: '15px',
        padding: '20px',
    },
    metricHeader: {
        display: 'flex',
        alignItems: 'center',
        gap: '10px',
        marginBottom: '15px',
    },
    metricIcon: {
        fontSize: '20px',
    },
    metricLabel: {
        fontSize: '14px',
        color: colors.neutral[700],
        fontWeight: '500',
    },
    progressBar: {
        height: '8px',
        backgroundColor: colors.neutral[200],
        borderRadius: '4px',
        overflow: 'hidden',
        marginBottom: '10px',
    },
    progressFill: {
        height: '100%',
        borderRadius: '4px',
        transition: 'width 0.5s ease',
    },
    metricValue: {
        fontSize: '20px',
        fontWeight: '600',
        color: colors.neutral[900],
    },
    statsGrid: {
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: '15px',
        marginBottom: '25px',
    },
    statItem: {
        display: 'flex',
        alignItems: 'center',
        gap: '15px',
        backgroundColor: colors.primary[50],
        padding: '15px',
        borderRadius: '12px',
    },
    statIcon: {
        fontSize: '24px',
    },
    statValue: {
        fontSize: '18px',
        fontWeight: '600',
        color: colors.neutral[900],
    },
    statLabel: {
        fontSize: '12px',
        color: colors.neutral[600],
    },
    insights: {
        backgroundColor: colors.secondary[50],
        padding: '20px',
        borderRadius: '15px',
    },
    insightsTitle: {
        fontSize: '16px',
        fontWeight: '600',
        color: colors.neutral[800],
        marginBottom: '15px',
    },
    insightsList: {
        listStyle: 'none',
        padding: 0,
        margin: 0,
    },
    insightsListLi: {
        padding: '5px 0',
        color: colors.neutral[700],
        fontSize: '14px',
        display: 'flex',
        alignItems: 'center',
    },
    insightsListLiBefore: {
        content: '"‚Ä¢"',
        color: colors.secondary[500],
        fontWeight: 'bold',
        display: 'inline-block',
        width: '1em',
        marginLeft: '-1em',
    },
};
